    //             numPages: "",
    //             primary_isbn10: "",
    //             publisher: "",
    //             reviews: "",
    //             title: "",
    //             url: ""
    return (
        <div>
            <div>title: <img a={props.book.title}/></div>
            <div>title: {props.book.title}</div>
            <div>Author: {props.book.title}</div>
            <div>title: {props.book.title}</div>
            <div>title: {props.book.title}</div>
            <div>title: {props.book.title}</div>
            <div>title: {props.book.title}</div>
            <div>title: {props.book.title}</div>
            <div>title: {props.book.title}</div>
        </div>
    );
};

export default BookContainer;
